function title2URL($url){
    # Prep string with some basic normalization
    $arr_str = explode(' ', $url);
	$arr_str = array_slice($arr_str, 0, 40 );
	$url= implode(' ', $arr_str);
    $url = strtolower($url);
    $url = strip_tags($url);
    $url = stripslashes($url);
    $url = html_entity_decode($url);
    # Remove quotes (can't, etc.)
    $url = str_replace('\'', '', $url);
    # Replace non-alpha numeric with hyphens
    $match = '/[^a-z0-9]+/';
    $replace = '-';
    $url = preg_replace($match, $replace, $url);
    $url = trim($url, '-');
    return $url;
}
function curl($url){
 
    $headers[]  = "User-Agent:Mozilla/5.0 (Windows; U; Windows NT 5.1; en-US; rv:1.9.2.13) Gecko/20101203 Firefox/3.6.13";
    $headers[]  = "Accept:text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8";
    $headers[]  = "Accept-Language:en-us,en;q=0.5";
    $headers[]  = "Accept-Encoding:gzip,deflate";
    $headers[]  = "Accept-Charset:ISO-8859-1,utf-8;q=0.7,*;q=0.7";
    $headers[]  = "Keep-Alive:115";
    $headers[]  = "Connection:keep-alive";
    $headers[]  = "Cache-Control:max-age=0";
 
    $curl = curl_init();
    curl_setopt($curl, CURLOPT_URL, $url);
    curl_setopt($curl, CURLOPT_FOLLOWLOCATION, 1);
    curl_setopt($curl, CURLOPT_MAXREDIRS, 2);
    //curl_setopt($curl, CURLOPT_HTTPHEADER, $headers);
	curl_setopt($curl, CURLOPT_USERAGENT, random_user_agent());
    curl_setopt($curl, CURLOPT_ENCODING, "gzip");
    curl_setopt($curl, CURLOPT_RETURNTRANSFER, 1);
    curl_setopt($curl, CURLOPT_CONNECTTIMEOUT, 10);
    curl_setopt($curl, CURLOPT_FOLLOWLOCATION, 1);
 
    $data = curl_exec($curl);
    curl_close($curl);
    return $data;
}

function grabBING($text = null, $count, $type){
    if (empty($text)) {
        $query = 'manual book';
    } else {
        $query = $text;
    }
    $host                = "www.bing.com";
    $uri                 = "search";
    $params['q']         = $query."+filetype:". $type;
    $params['go']        = "";
    $params['qs']        = "n";
    $params['form']      = "";
    $params['pq']        = $query."+filetype:". $type;
    $params['sc']        = "0-0";
    $params['sp']        = "-1";
    $params['sk']        = "";
    $params['count']     = $count;
    $params['format']    = "rss";
    $canonicalized_query = array();
    foreach ($params as $param => $value) {
        $canonicalized_query[] = $param . "=" . $value;
    }
    $canonicalized_query = implode("&", $canonicalized_query);
    $request             = "http://" . $host . "/" . $uri . "?" . $canonicalized_query;
    $feed                = rawurlencode($request);
    $ip                  = $_SERVER['REMOTE_ADDR'];
    $randIP              = long2ip(rand(0, "4294967295"));
    $url                 = "http://ajax.googleapis.com/ajax/services/feed/load?v=2.0&q=" . $feed . "&num=" . $count . "&userip=".$randIP;

    //using curl

    $ch = curl_init();
    curl_setopt($ch, CURLOPT_URL, $url);
    curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
    curl_setopt($ch, CURLOPT_REFERER, 'https://www.google.com');
    curl_setopt($ch, CURLOPT_USERAGENT, random_user_agent());
    $return = curl_exec($ch);
    curl_close($ch);

    //$return              = file_get_contents($url);
    //echo $return;
    $json   = json_decode($return, true);
    return $json;
}
